// =======================================================================================
// Custom js



// Global parameters
window.params = {
    isMobile: /Android|webOS|iPhone|iPad|iPod|BlackBerry|IEMobile|Opera Mini/i.test(navigator.userAgent),
    isIOS: /iPhone|iPad|iPod/i.test(navigator.userAgent)
};

//Check if element exist on page
function exist(el){
    if ( $(el).length > 0 ) {
        return true;
    } else {
        return false;
    }
}

/*---------------------------
                              Scroll
---------------------------*/
if ( exist('.scroll') ) {
    $(window).on('load resize', function(event) {
        event.preventDefault();
        if ( $(window).width() <= 1000 ) {
            $('.scroll').mCustomScrollbar('destroy');
        } else {
            $('.scroll').mCustomScrollbar({
                axis:"y",
                theme: 'dark-thick'
            });
        }
    });
} 

jQuery(document).ready(function($) {

    /*---------------------------
                                  MENU TOGGLE
    ---------------------------*/
    $('#menu-toggle').on('click', function(event) {
        event.preventDefault();
        $(this).toggleClass('open');
        $('#search').removeClass('open');
        
        $('#menu').toggleClass('open');

    });

    $('#seacrh-toggle a').on('click', function(event) {
        event.preventDefault();
        $(this).toggleClass('open');

        $('#menu').removeClass('open');
        $('#menu-toggle').removeClass('open');
        $('#search').toggleClass('open');

        $('#serch-input').focus();
        var val = $('#serch-input').val();
        $('#serch-input').val('');
        $('#serch-input').val(val);

    });


    $('.tabs-nav a').click(function(e){
        e.preventDefault();
        var target = $(this).attr('href');
        $('.tabs-nav a').removeClass('active');
        $(this).addClass('active');
        $('.tab').hide();
        $(target).fadeIn('slow');
    });

    /*---------------------------
                                  Fancybox
    ---------------------------*/
    $('.fancybox').fancybox({});


    /*---------------------------
                                  Mix it Up
    ---------------------------*/
    if ( exist('.mix-container') ) {
        var mixer = mixitup('.mix-container', {
            "animation": {
                "duration": 600,
                "nudge": true,
                "reverseOut": false,
                "effects": "fade scale(0.1) translateZ(-100px)"
            }
        });
    }




    /*---------------------------
                                  Select tabs
    ---------------------------*/
    $('.js-open-select').on('click', function(event) {
        event.preventDefault();
        /* Act on the event */
        $(this).parent().toggleClass('active');
    });

    $('.select-option').on('click', function(event) {
        event.preventDefault();
        $('.select-option').removeClass('active');
        $(this).addClass('active');
        $('.select-label-holder').text( $(this).text() );
        $(this).parents('.select').removeClass('active');

        var target = $(this).attr('href');
        if ( exist(target) ) {
            $('.tab').removeClass('active');
            $(target).addClass('active');
        }
    });



    /*---------------------------
                                  Sliders
    ---------------------------*/
    $('.products-logos').slick({
        arrows: false,
        dots: false,
        autoplay: true,
        slidesToShow: 7,
        slidesToScroll: 1,
        responsive: [
            {
                breakpoint: 1200,
                settings: {
                    slidesToShow: 6
                }
            },
            {
                breakpoint: 900,
                settings: {
                    slidesToShow: 5
                }
            },
            {
                breakpoint: 700,
                settings: {
                    slidesToShow: 4
                }
            },
            {
                breakpoint: 500,
                settings: {
                    slidesToShow: 3
                }
            }
        ]
    });

    $('.offer__slider').slick({
        arrows: false,
        dots: false,
        autoplay: true,
        fade: true,
        asNavFor: '.slider-nav',
    });

    $('.slider-nav').slick({
        slidesToShow: 6,
          slidesToScroll: 1,
          asNavFor: '.offer__slider',
          dots: false,
          arrows: true,
          focusOnSelect: true,
          responsive: [
            {
              breakpoint: 600,
              settings: {
                slidesToShow: 3,
              }
            },
            {
              breakpoint: 400,
              settings: {
                slidesToShow: 2,
              }
            }
          ]
    });


    $('.product-main-slider').slick({
        arrows: true,
        dots: false,
        fade: true,
        asNavFor: '.product-thumbnails-slider'
    });

    $('.product-preview').on('click', function(event) {
        event.preventDefault();
        var product_popup = $(this).attr('href');
        if ( exist( product_popup ) ) {
            $(product_popup).addClass('active');
        } 
    });

    $('.close-popup').on('click', function(event) {
        event.preventDefault();
        $('.product-popup').removeClass('active');
    });

    function re_height() {
        var height = $('.product-thumbnails-slider').height();
        $('.product-thumbnails-slider').find('.slide').height(height/4);
        $('.product-thumbnails-slider').find('.slick-list').height(height);
    }
    $('.product-thumbnails-slider').on('init', function(event, slick) {
        event.preventDefault();
        re_height();
    });
    
    $('.product-thumbnails-slider').slick({
        arrows: true,
        dots: false,
        vertical: true,
        verticalSwiping: true,
        slidesToShow: 4,
        slidesToScroll: 1,
        focusOnSelect: true,
        asNavFor: '.product-main-slider'
    });

    $('.product-popup').each(function(index, el) {
        var main_slider = $(this).find('.product-main-slider');
        var thumbnail_slider = $(this).find('.product-thumbnails-slider');
        main_slider.slick('slickSetOption', 'asNavFor', thumbnail_slider, true);
        thumbnail_slider.slick('slickSetOption', 'asNavFor', main_slider, true);
    });

    $(window).on('resize', function(event) {
        event.preventDefault();
        re_height();
        $('.product-thumbnails-slider').slick('setPosition');
    });
    


    /*----------------------------
                              SEND FORM
    -------------------------*/
    /**
     *
     * Open popup
     *
    */
    function openPopup(popup){
        $.fancybox.open([
            {
                src  : popup,
                type: 'inline',
                opts : {}
            }
        ], {
            loop : false
        });
    }

    $('.form').on('submit', function(event) {
        event.preventDefault();
        var data = new FormData(this);
        $(this).find('button').prop('disabled', true);
        $.ajax({
            url: theme.url + '/forms.php',
            type: 'POST',
            data: data,
            cache: false,
            contentType: false,
            processData: false,
            success: function(result) {
                if (result.status == 'ok') {
                    openPopup('#modal-popup-ok')
                } else {
                    openPopup('#modal-popup-error')
                }
            },
            error: function(result) {
                openPopup('#modal-popup-error');
            }
        }).always(function() {
            $('form').each(function(index, el) {
                $(this)[0].reset();
                $(this).find('button').prop('disabled', false);
            });
        });
    });


    var coordinates = [];
    $('.select-option').each(function(index, el) {
        coordinates[index] = {
            'lat': $(this).data('lat')*1,
            'lng': $(this).data('lng')*1,
        }
    });

    /*Google map init*/
    var map;
    function googleMap_initialize() {

        if ( coordinates.length == 0 ) {
            var lat = $('#map_canvas').data('lat');
            var long = $('#map_canvas').data('lng');
            var zoom = $('#map_canvas').data('zoom');
            var marker_icon = $('#map_canvas').data('marker');    
        } else {
            var lat = coordinates[0].lat;
            var long = coordinates[0].lng;
            var zoom = 15;
            var marker_icon = $('#map_canvas').data('marker');   
        }


        var mapCenterCoord = new google.maps.LatLng(lat, long);
        var mapMarkerCoord = new google.maps.LatLng(lat, long);

        var mapOptions = {
            center: mapCenterCoord,
            zoom: zoom,
            //draggable: false,
            disableDefaultUI: true,
            scrollwheel: false,
            mapTypeId: google.maps.MapTypeId.ROADMAP
        };

        map = new google.maps.Map(document.getElementById('map_canvas'), mapOptions);

        if ( coordinates.length == 0 ) {
            var markerImage = new google.maps.MarkerImage(marker_icon);
            var marker = new google.maps.Marker({
                icon: markerImage,
                position: mapMarkerCoord, 
                map: map,
                title:"Ceylan"
            });
        } else {
            $.each(coordinates, function(index, el) {
                console.log(coordinates[index].lat);
                var markerImage = new google.maps.MarkerImage(marker_icon);
                var marker = new google.maps.Marker({
                    icon: markerImage,
                    position: new google.maps.LatLng(coordinates[index].lat, coordinates[index].lng), 
                    map: map,
                    title:"Ceylan"
                });
            });
        }

        $('.js-set-map-coordinates').on('click', function(event) {
            event.preventDefault();
            mapCenterCoord = new google.maps.LatLng( $(this).data('lat')*1, $(this).data('lng')*1 );
            console.log();
            map.setCenter(mapCenterCoord);
        });


        $('.js-set-zoom-plus').on('click', function(event) {
            event.preventDefault();
            map.setZoom( map.getZoom() + 1 )
        });

        $('.js-set-zoom-minus').on('click', function(event) {
            event.preventDefault();
            map.setZoom( map.getZoom() - 1 )
        });

        $('.js-set-view-satellite').on('click', function(event) {
            event.preventDefault();
            $(this).siblings().removeClass('active');
            $(this).addClass('active');

            map.setMapTypeId(google.maps.MapTypeId.SATELLITE);
        });

        $('.js-set-view-roadmap').on('click', function(event) {
            event.preventDefault();
            $(this).siblings().removeClass('active');
            $(this).addClass('active');

            map.setMapTypeId(google.maps.MapTypeId.ROADMAP);
        });
        
        $(window).resize(function (){
            map.setCenter(mapCenterCoord);
        });
    }

    if ( exist( '#map_canvas' ) ) {
        googleMap_initialize();
    }

}); // end file